import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { Link } from 'react-router-dom';



export default function Adminmainpage() {
    const navigate = useNavigate();
    const data = useLocation();
    const authtoken = data.state.authtoken;

    return (
        <>

            <div className='navbar'>
                <h1>Admin Panel </h1>
            </div>




            <div className='mainpage-div'>

                <button type="button" class="btn btn-primary ms-3" onClick={() => {
                    navigate("/viewallusers", { state: { authtoken: authtoken } });
                }}>View All Users Records</button>

                <Link to="/" type="button" class="btn btn-secondary ms-3">Leave Approval</Link>
                <Link to="/admin/generatereport" type="button" class="btn btn-info ms-3" >Generate All users Report</Link>
            </div>
        </>
    )
}
